syntax = "proto3";

package make87_messages_ros2.rolling.ublox_msgs.msg;


message NavSBASSV {
     uint32 svid = 1;
     uint32 flags = 2;
     uint32 udre = 3;
     uint32 sv_sys = 4;
     uint32 sv_service = 5;
     uint32 reserved1 = 6;
